export function pickRandomName(pool: string[]): string {
  return pool[Math.floor(Math.random() * pool.length)];
}

export function generatePlayerName(): { firstName: string; lastName: string } {
  return {
    firstName: pickRandomName(FIRST_NAMES),
    lastName: pickRandomName(LAST_NAMES),
  };
}
